import React from 'react';
// Font Awesome
import '../FontAwesome';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
function Header(){
    return(
        // <div className="background background-header"> 
        //     <div className="container header">
        //             <a href="/" className="header-logo">
        //                 <img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo"></img>
        //             </a>
        //             <ul className="header-navbar">
        //                 <li><a href="/" className="header-navbar-link">HOME</a></li>
        //                 <li><a href="/" className="header-navbar-link">ITEM  <FontAwesomeIcon icon="angle-down"/></a></li>
        //                 <li><a href="/" className="header-navbar-link">PET <FontAwesomeIcon icon="angle-down"/></a></li>
        //             </ul>
        //             <div className="header-auth">
        //                 <a href="/"className="header-auth-link"><FontAwesomeIcon icon="user-circle"/> Login/Register</a>
        //                 <a href="/"className="header-auth-link"> <FontAwesomeIcon icon="shopping-cart"/></a>
        //             </div>
                     
        //     </div>
        //     <div className="header-banner">
        //                 asddsaadsdsa
        //     </div>    
        // </div>
        <div className="blabla">
            <div className="header">
                <nav className="header-navbar">
                <a href="/" className="header-logo">
                      <img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo"></img>
                </a>
                <ul>
                    <li>
                        <div className="header-navbar-menu">
                            <div className="header-navbar-menu-inner">
                                <p>Dresses</p>
                                <p>Outdoor</p>
                                <p>Indoor</p>
                                <p>Sport</p>
                            </div>
                        </div>
                    </li>
                    <li>Home</li>
                    <li>Item <FontAwesomeIcon icon="angle-down"/></li>
                    <li>Pet <FontAwesomeIcon icon="angle-down"/></li>
                    <li><FontAwesomeIcon icon="user-circle"/> My Account</li>
                    <li><FontAwesomeIcon icon="shopping-cart"/></li>
                </ul>
                </nav>
                <div className="header-banner">
                    
                </div>
            </div>
            

        </div>
    )
};
export default Header;
